const DiaryItem = ({author,content,emotion,created_date})=>{
    return(
        <div className="Diaryitem">
            <span className="info">
                작성자 : {author} | 감정 점수 : {emotion}
            </span>
            <br/>
            <span className="date">
                {new Date(created_date).toLocaleString()}
            </span>
            <br/>
            <div>{content}</div>
        </div>
    )
}

export default DiaryItem;
